import React from "react";
import "./Form.css"

class Form extends React.Component {
  render() {
    return (
      <div>
        <form className="form">
          <input type="text" name="city" placeholder="City..."/>
          <input type="text" name="country" placeholder="Country..."/>
          <button onClick={this.props}>Get Weather</button>
        </form>
      </div>
    )
 }  
}

export default Form;
